import React from 'react';
import QuoteItem from './QuoteItem';

const Quotes = ({ quotes, count }) => {
  return (
    <div className={quoteStyle}>
      {quotes.length > 0 &&
        quotes.map(quote => <QuoteItem key={quote.quote_id} quote={quote} />)}
    </div>
  );
};

const quoteStyle = {
  display: 'flex',
  flexDirection: 'column'
};

export default Quotes;
